import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';
import '../styles/CardStyle.css';

function CardElement() {
  return (
    <div>
      <div class="card">
        <div class="card-info">
          <p class="title">Magic Card</p>
        </div>
      </div>
    </div>
  );
}

export default CardElement;
